import React, { useState } from 'react';
import {
  ThemeProvider,
  CssBaseline,
  Box,
  AppBar,
  Toolbar,
  Typography,
  Container,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  IconButton,
  useMediaQuery,
  useTheme,
  Divider,
} from '@mui/material';
import {
  Menu as MenuIcon,
  LocalHospital as DiagnosisIcon,
  Timeline as MetricsIcon,
  Medication as MedicationIcon,
  Assignment as SymptomsIcon,
} from '@mui/icons-material';
import { theme } from './theme';
import Diagnosis from './components/Diagnosis';
import HealthMetrics from './components/HealthMetrics';
import MedicationTracker from './components/MedicationTracker';
import SymptomTracker from './components/SymptomTracker';

const drawerWidth = 240;

function App() {
  const [mobileOpen, setMobileOpen] = useState(false);
  const [selectedTab, setSelectedTab] = useState('diagnosis');
  const appTheme = useTheme();
  const isMobile = useMediaQuery(appTheme.breakpoints.down('md'));

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const menuItems = [
    { id: 'diagnosis', label: 'Diagnosis', icon: <DiagnosisIcon /> },
    { id: 'symptoms', label: 'Symptom Tracker', icon: <SymptomsIcon /> },
    { id: 'metrics', label: 'Health Metrics', icon: <MetricsIcon /> },
    { id: 'medications', label: 'Medications', icon: <MedicationIcon /> },
  ];

  const drawer = (
    <Box>
      <Toolbar>
        <Typography variant="h6" noWrap component="div">
          Medical Assistant
        </Typography>
      </Toolbar>
      <Divider />
      <List>
        {menuItems.map((item) => (
          <ListItem
            button
            key={item.id}
            onClick={() => {
              setSelectedTab(item.id);
              if (isMobile) setMobileOpen(false);
            }}
            selected={selectedTab === item.id}
          >
            <ListItemIcon sx={{ color: selectedTab === item.id ? 'primary.main' : 'inherit' }}>
              {item.icon}
            </ListItemIcon>
            <ListItemText primary={item.label} />
          </ListItem>
        ))}
      </List>
    </Box>
  );

  const renderContent = () => {
    switch (selectedTab) {
      case 'diagnosis':
        return <Diagnosis />;
      case 'symptoms':
        return <SymptomTracker />;
      case 'metrics':
        return <HealthMetrics />;
      case 'medications':
        return <MedicationTracker />;
      default:
        return <Diagnosis />;
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ display: 'flex', minHeight: '100vh' }}>
        <AppBar
          position="fixed"
          sx={{
            width: { md: `calc(100% - ${drawerWidth}px)` },
            ml: { md: `${drawerWidth}px` },
          }}
        >
          <Toolbar>
            <IconButton
              color="inherit"
              edge="start"
              onClick={handleDrawerToggle}
              sx={{ mr: 2, display: { md: 'none' } }}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" noWrap component="div">
              {menuItems.find(item => item.id === selectedTab)?.label}
            </Typography>
          </Toolbar>
        </AppBar>

        <Box
          component="nav"
          sx={{ width: { md: drawerWidth }, flexShrink: { md: 0 } }}
        >
          <Drawer
            variant={isMobile ? 'temporary' : 'permanent'}
            open={isMobile ? mobileOpen : true}
            onClose={handleDrawerToggle}
            ModalProps={{
              keepMounted: true, // Better open performance on mobile.
            }}
            sx={{
              '& .MuiDrawer-paper': {
                boxSizing: 'border-box',
                width: drawerWidth,
              },
            }}
          >
            {drawer}
          </Drawer>
        </Box>

        <Box
          component="main"
          sx={{
            flexGrow: 1,
            p: 3,
            width: { md: `calc(100% - ${drawerWidth}px)` },
            mt: ['56px', '64px'],
            backgroundColor: 'background.default',
          }}
        >
          <Container maxWidth="xl">
            {renderContent()}
          </Container>
        </Box>
      </Box>
    </ThemeProvider>
  );
}

export default App;
